body {
  font-size: 12px;
}

.nav__barre {
  z-index: 2;
  width: 100%;
  position: fixed;
  bottom: 0px;
}
.nav__barre nav {
  z-index: 10;
  background-color: black;
  height: 52px;
  padding-top: 15px;
}
.nav__barre nav img {
  display: block;
  height: 23px;
  margin: 5px auto auto auto;
  z-index: 10;
}
.nav__barre nav ul {
  position: absolute;
}
.nav__barre nav ul li {
  width: 42px;
  height: 3px;
  background-color: white;
  margin: 5px 0px 5px 20px;
}

.video {
  max-width: 100vw;
  max-height: 40vh;
  overflow: hidden;
}
.video video {
  width: 100%;
  height: 100%;
}

.nav__place {
  background-color: #2B2B2B;
  z-index: auto;
  height: 203px;
  transform: translateY(0px);
  position: fixed;
  bottom: 0px;
  width: 100%;
  z-index: 1;
}

.article {
  margin-top: 10px;
  height: 577px;
  width: 98%;
  background-color: #F4F4F4;
  text-align: center;
  overflow: hidden;
}
.article h2 {
  font-size: 18px;
  padding-top: 70px;
}
.article p {
  padding-top: 20px;
}
.article img {
  margin-left: 4%;
  height: 306px;
  width: 214px;
  padding-top: 80px;
}

.look__the__produit {
  color: white;
  font-size: 22px;
  height: 42px;
  width: 199px;
  display: block;
  margin: auto;
  background-color: #181818;
  margin-top: 40px;
  border: none;
}

.article--black {
  color: white;
  background-color: black;
}

